ounty Jail, Florida, USA | Prison Documentary\\n\\nBehind Bars - Dallas County Jail, Texas, USA: https:\/\/youtu.be\/fkX2hanoYyM\\n\\nThe two toughest divisions of the Miami Dade prison complex couldn't be more different. The Miami Dade Boot Camp gives minor offenders a chance to escape the prison through rigorous and unforgiving drills and rules. To many it is a better alternative to rusty iron bars of The Miami-Dade County Jail where murderers, rapists and robbers have their own rules of survival.\\n\\nThe series accompanies guards on their daily routines: those who struggle to maintain law and order and those who abuse their powers mercilessly.  But above all, each episode allows the viewer to see the world from the prisoner’s point of view: the newcomer spending his first terrifying night locked up. Felons who live for the day when their fate will be decided: will it be life behind bars? A worse fate? Foreigners, far away from home, languishing away under the most horrendous conditions. And mothers who have to raise their children in the shadow of prison bars. \\n▬▬▬▬▬▬▬▬▬\\nSubscribe Free Documentary Channel for free: https:\/\/bit.ly\/2YJ4XzQ\\nJoin the club and become a Free Documentary Patron: https:\/\/www.patreon.com\/freedocumentary \\nFacebook: https:\/\/bit.ly\/2QfRxbG\\nTwitter: https:\/\/bit.ly\/2QlwRiI\\n▬▬▬▬▬▬▬▬▬\\n#FreeDocumentary #Documentary #BehindBars\\n▬▬▬▬▬▬▬▬▬\\n\\nFree Documentary is dedicated to bringing high-class documentaries to you on YouTube for free. With the latest camera equipment used by well-known filmmakers working for famous production studios. You will see fascinating shots from the deep seas and up in the air, capturing great stories and pictures from everything our beautiful and interesting planet has to offer. \\n\\nEnjoy stories about nature, wildlife, culture, people, history and more to come.\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/iAW9gjurr8g\/hqdefault.jpg?sqp=-oaymwE jurr8g?version=3\\u0026autohide=1\"},\"title\":{\"simpleText\":\"Behind Bars: The World’s Toughest Prisons - Miami, Dade County Jail, Florida, USA | Free Documentary\"},\"description\":{\"simpleText\":\"Behind Bars - Episode 6: Miami, Dade County Jail, Florida, USA | Prison Documentary\\n\\nBehind Bars - Dallas County Jail, Texas, USA: https:\/\/youtu.be\/fkX2hanoYyM\\n\\nThe two toughest divisions of the Miami Dade prison complex couldn't be more different. The Miami Dade Boot Camp gives minor offenders a chance to escape the prison through rigorous and unforgiving drills and rules. To many it is a better alternative to rusty iron bars of The Miami-Dade County Jail where murderers, rapists and robbers have their own rules of survival.\\n\\nThe series accompanies guards on their daily routines: those who struggle to maintain law and order and those who abuse their powers mercilessly.  But above all, each episode allows the viewer to see the world from the prisoner’s point of view: the newcomer spending his first terrifying night locked up. Felons who live for the day when their fate will be decided: will it be life behind bars? A worse fate? Foreigners, far away from home, languishing away under the most horrendous conditions. And mothers who have to raise their children in the shadow of prison bars. \\n▬▬▬▬▬▬▬▬▬\\nSubscribe Free Documentary Channel for free: https:\/\/bit.ly\/2YJ4XzQ\\nJoin the club and become a Free Documentary Patron: https:\/\/www.patreon.com\/freedocumentary \\nFacebook: https:\/\/bit.ly\/2QfRxbG\\nTwitter: https:\/\/bit.ly\/2QlwRiI\\n▬▬▬▬▬▬▬▬▬\\n#FreeDocumentary #Documentary #BehindBars\\n▬▬▬▬▬▬▬▬▬\\n\\nFree Documentary is dedicated to bringing high-class documentaries to you on YouTube for free. With the latest camera equipment used by well-known filmmakers working for famous production studios. You will see fascinating shots from the deep seas and up in the air, capturing great stories and pictures from everything our beautiful and interesting planet has to offer. \\n\\nEnjoy stories about nature, wildlife, culture, people, history and more to come.\"},\"lengthSeconds\":\"2881\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/FreeDocumentary\",\"externalChannelId\":\"UCijcd0GR0fkxCAZwkiuWqtQ\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"KM\",\"KN\",\"KP\",\"KR\",\"KW\",\"KY\",\"KZ\",\"LA\",\"LB\",\"LC\",\"LI\",\"LK\",\"LR\",\"LS\",\"LT\",\"LU\",\"LV\",\"LY\",\"MA\",\"MC\",\"MD\",\"ME\",\"MF\",\"MG\",\"MH\",\"MK\",\"ML\",\"MM\",\"MN\",\"MO\",\"MP\",\"MQ\",\"MR\",\"MS\",\"MT\",\"MU\",\"MV\",\"MW\",\"MX\",\"MY\",\"MZ\",\"NA\",\"NC\",\"NE\",\"NF\",\"NG\",\"NI\",\"NL\",\"NO\",\"NP\",\"NR\",\"NU\",\"NZ\",\"OM\",\"PA\",\"PE\",\"PF\",\"PG\",\"PH\",\"PK\",\"PL\",\"PM\",\"PN\",\"PR\",\"PS\",\"PT\",\"PW\",\"PY\",\"QA\",\"RE\",\"RO\",\"RS\",\"RU\",\"RW\",\"SA\",\"SB\",\"SC\",\"SD\",\"SE\",\"SG\",\"SH\",\"SI\",\"SJ\",\"SK\",\"SL\",\"SM\",\"SN\",\"SO\",\"SR\",\"SS\",\"ST\",\"SV\",\"SX\",\"SY\",\"SZ\",\"TC\",\"TD\",\"TF\",\"TG\",\"TH\",\"TJ\",\"TK\",\"TL\",\"TM\",\"TN\",\"TO\",\"TR\",\"TT\",\"TV\",\"TW\",\"TZ\",\"UA\",\"UG\",\"UM\",\"US\",\"UY\",\"UZ\",\"VA\",\"VC\",\"VE\",\"VG\",\"VI\",\"VN\",\"VU\",\"W irst terrifying night locked up. Felons who live for the day when their fate will be decided: will it be life behind bars? A worse fate? Foreigners, far away from home, languishing away under the most horrendous conditions. And mothers who have to raise their children in the shadow of prison bars. \n▬▬▬▬▬▬▬▬▬\nSubscribe Free Documentary Channel for free: https://bit.ly/2YJ4XzQ\nJoin the club and become a Free Documentary Patron: https://www.patreon.com/freedocumentary \nFacebook: https://bit.ly/2QfRxbG\nTwitter: https://bit.ly/2QlwRiI\n▬▬▬▬▬▬▬▬▬\n#FreeDocumentary #Documentary #BehindBars\n▬▬▬▬▬▬▬▬▬\n\nFree Documentary is dedicated to bringing high-class documentaries to you on YouTube for free. With the latest camera equipment used by well-known filmmakers working for famous production studios. You will see fascinating shots from the deep seas and up in the air, capturing great stories and pictures from everything our beautiful and interesting planet has to offer. \n\nEnjoy stories about nature, wildlife, culture, people, history and more to come."},"lengthSeconds":"2881","ownerProfileUrl":"http://www.youtube.com/user/FreeDocumentary","externalChannelId":"UCijcd0GR0fkxCAZwkiuWqtQ","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT
